import React from "react";
import "./ListSearch.css";

const ListSearch = () => {
  return (
    <div className="list-search position-absolute w-100">
      <input list="browsers" name="browser" className="w-100"/>
      <datalist id="browsers">
        <option value="Internet Explorer" />
        <option value="Firefox" />
        <option value="Chrome" />
        <option value="Opera" />
        <option value="Safari" />
      </datalist>
    </div>
  );
};

export default ListSearch;
